    false,nt"url": null,nt"notes": "This narrative report for Pablo National
    Wildlife Refuge outlines Refuge accomplishments from January through April of 1963.
    The report begins by summarizing the weather conditions, water conditions, habitat
    conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, big game animals,  furbearers, predators, rodents, raptors,
    fish, reptiles, fish, and disease- is also covered. The Refuge development and maintenance
    section discusses physical developments. Resource management is outlined; topics
    include grazing. A progress report on field investigations and applied research
    is also provided. The public relations section of the report describes recreational
    uses, Refuge visitors, refuge participation, and violations. N-R forms are attached.",nt"license_title":
